import React, { Component } from 'react'
import { Link ,Router} from 'react-router-dom'

class navbar extends Component {
    render() {
        return (
                <div className="navbar">
                    <h2 className="logo">OA</h2>
                    <Router>
                    <ul>
                        
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>About Me</li>
                        <li>Interest Areas</li>
                        <li>Contact</li>
                    </ul>
                    </Router>

                </div>
        )
    }
}

export default navbar;
